function addGoToTop(){let toc=document.querySelectorAll('[aria-label="Table of contents"]');if(toc.length>1){toc[1].innerHTML+='<a href="#top" id="gototop">Back to top</a>';}}
window.MathJax={tex:{inlineMath:[["\\(","\\)"]],displayMath:[["\\[","\\]"]],processEscapes:true,processEnvironments:true},options:{ignoreHtmlClass:".*|",processHtmlClass:"arithmatex"}};document$.subscribe(()=>{MathJax.typesetPromise()})
document$.subscribe(function(){var elements=document.getElementsByClassName("lightgallery");for(var i=0;i<elements.length;i++){lightGallery(elements[i],{counter:false});}})
document$.subscribe(()=>{addGoToTop();})